import React from "react";
import { proy } from "./constantes";

export function menuproyectos() {
    const mensec = document.getElementById("mens");
    const contenido = document.getElementById("contenido");
    mensec.innerHTML = "";
    mensec.appendChild(proy[0]);
    
}
